import React from "react";
import "./styles.css";
import { ReactTerminal } from "react-terminal";

export default function App() {
  const commands = {
    whoami: "Sibu Stephen Front end Developer by profession",
    "tellmore": "Like to write, likes to code, also likes to DJ at times :)",
    "wheretofind": "Sibu Currently resides in  pune , but loves to explore new places.",
  };

  const welcomeMessage = (
    <span>
      welcome to Sibu terminal type the following available commands: {Object.keys(commands).join(", ")}
      <br />
    </span>
  );

  return (
    <div className="App">
      <ReactTerminal welcomeMessage={welcomeMessage} commands={commands} />
    </div>
  );
}
